settings\u0004Note: To disable a context:
Nota: Para desativar um item do menu de contexto,
copie para as Preferências do Usuário e adicione a tecla
"disabled". O exemplo a seguir desativará o download do item nos arquivos:
{
  "contextMenu": [
    {
      "command": "filebrowser:download",
      "selector": ".jp-DirListing-item[data-isdir=\"false\"]",
      "disabled": true
    }
  ]
}

