settings\u0004Overrides default widget p:
Substitui a posição de widget padrão no layout do aplicativo
Por exemplo, para posicionar terminais na barra lateral direita em modo de vários documentos e em baixo estão em modo de documento único, {
  "single": { "Terminal": { "area": "down" } },
  "multiple": { "Terminal": { "area": "right" }
}.
